INSERT INTO `amusement_facility` VALUES (1, '重庆之眼', '西南地区最大的摩天轮，达到120米的高度，如在云端，俯瞰大地时的特殊角度，更能启迪思维，别有一番滋味。', '106.515024', '29.667114', 112, 15, '旋转', '成人/老少皆宜/家长监护', '16:30:00', '22:00:00', 1, '2024-04-03 11:01:48', '2024-04-17 11:21:41', 0, '120cm（含120cm）以下须成人陪同', 0, 300);
INSERT INTO `amusement_facility` VALUES (2, '翼飞冲天', '侏罗纪时期的翼龙突然再现地球，摆动着巨大的双翼，穿梭在丛林峡谷之间。勇敢的人类，爬上翼龙的双翼，上下无遮挡，与其一道凌空飞行。', '106.520137', '29.668583', 36, 5, '过山车/轨道/失重', '成人', '10:30:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-16 18:15:12', 0, '60周岁以下游客乘坐', 135, 190);
INSERT INTO `amusement_facility` VALUES (3, '激流勇进', '从27米的高度俯冲而下的游船，激起的浪花也将是前所未有的一种新奇体验，滔天巨浪，惊心动魄。宏伟、壮观、惊险、刺激。', '106.517368', '29.668591', 20, 5, '轨道/水上/失重', '成人', '11:00:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-16 18:15:48', 0, '130cm-140cm（含140cm）须成人陪同，65周岁以下', 130, 190);
INSERT INTO `amusement_facility` VALUES (4, '尖峰时刻', '适合全年龄段的低空跳楼机。缓慢的抬升，给游客带来期待无限；攀至顶峰，从高空眺望远处，俯瞰无限风光，感受园区欢乐；而后在地心引力的作用下急速坠落，忽然又再次升空，惊心还在继续。', '106.515250', '29.666280', 16, 3, '垂直/高空/失重', '成人', '12:00:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-16 18:18:22', 0, '65周岁以下', 140, 190);
INSERT INTO `amusement_facility` VALUES (5, '高空飞翔', '满足你对飞翔的幻想，进入座椅，随着转盘旋转上升，感受离心力和运行高度的无穷乐趣，尖叫声不断，在观光上也是不错的选择。', '106.519623', '29.669792', 36, 5, '高空/旋转', '成人', '10:30:00', '18:00:00', 1, '2024-04-03 11:01:48', '2024-04-08 12:01:31', 0, '65周岁以下游客乘坐', 130, 190);
INSERT INTO `amusement_facility` VALUES (6, '欢乐对对碰', ' 碰碰车可爱多样的造型是每个人童年的回忆，疯狂的驾驶、激烈的碰撞、巧妙的躲避，欢乐对对碰不单是儿童的专属，还承载了每一个成年人的童年记忆，是一家人的欢乐聚集地。', '106.515511', '29.666732', 30, 5, '室内', '成人/老少皆宜/家长监护', '10:00:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-17 11:48:42', 0, '120cm-140cm（不含140cm）须成人陪同且坐副驾驶', 120, 300);
INSERT INTO `amusement_facility` VALUES (7, '旋转木马', '您乘坐着造型逼真、神态各异的木马或厢车，在光影和音乐中旋转、游走时，仿佛置身于童话般的伊甸园，享受着凭海临风的浪漫与优雅。', '106.518684', '29.666635', 68, 5, '旋转', '成人/老少皆宜/家长监护', '10:30:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-16 18:16:38', 0, '身高120cm以下的儿童需成人陪同', 0, 300);
INSERT INTO `amusement_facility` VALUES (8, '飞跃重庆', '随着座椅缓缓上升至高处，7层楼高的巨型球幕将100位游客包围其中，全方位视角呈现重庆壮丽山川美景，伴随着座椅角度的变化，让你身临其境，如鸟儿般自由飞翔。', '106.519488', '29.670265', 110, 10, '室内/剧场', '成人/家长监护', '10:30:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-16 18:21:14', 0, '60周岁以下游客乘坐', 120, 190);
INSERT INTO `amusement_facility` VALUES (9, '海盗船', '启动后从缓慢摆动慢慢地到急速摆动——犹如乘船出海遇到大风骇浪，时而冲上浪涛之颠，时而跌落波澜的谷底惊心动魄，既有趣又刺激。', '106.519496', '29.667503', 20, 3, '失重', '成人/家长监护', '10:30:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-16 18:20:16', 0, '110cm-140cm（不含140cm）须有成人陪同', 110, 190);
INSERT INTO `amusement_facility` VALUES (10, '灵异马戏团', '恐怖的场景，惊悚的鬼屋，真实世界的对立面。立体声效与恐怖特技造型完美结合，配合动感的特效灯光、道具等营造出黑暗深处的鬼魅，一个个令人心跳不已的场景，游客将体验身临其境的胆战心惊。', '106.514772', '29.666583', 8, 8, '鬼屋', '成人/家长监护', '11:00:00', '18:00:00', 0, '2024-04-03 11:01:48', '2024-04-08 12:01:53', 0, '120cm以下儿童须有监护能力的成人陪同', 0, 300);
