INSERT INTO `restaurant_facility` VALUES (1, '船长餐厅', '大工业时代码头风的滨海湾区的湖岸边坐落着加勒比海风格的船长餐厅。在这家浓郁航海味道的餐厅游客不仅能感受到热情好客的服务，还能享受到地道的粤式烧腊美味。坐在餐厅的户外用餐区，斜倚着美丽的人工湖的栏杆，视线前方除了风轻轻吹动的湖水外，还有那座浓郁工业风情的钢架大桥。旁边被餐厅遮挡的除了让很多人害怕体验的大摆锤外，还有餐厅另一侧小山上的直插天际的天地双雄。挡住的是视线，挡不住的是人们的热情。', '29.667593', '106.519117', '中式快餐/面点/饮品/小吃', '10:00:00', '18:00:00', 0, 20, 30, '2024-04-03 11:23:29', '2024-04-09 17:41:22', 0);
INSERT INTO `restaurant_facility` VALUES (2, '欢乐驿站', '游乐园的欢乐驿站餐厅，是每位游客在畅游之余，享受美食与休憩的理想之地。这里汇聚了多样化的美食选择，既有适合大人小孩的各类套餐，也有满足各种口味的特色小吃和饮品。餐厅的环境温馨舒适，装修风格充满童趣，与游乐园的整体氛围相得益彰。', '29.667422', '106.512782', '饮品/小吃', '10:00:00', '18:00:00', 0, 15, 20, '2024-04-03 11:23:31', '2024-04-09 17:41:38', 0);
INSERT INTO `restaurant_facility` VALUES (3, '丛林探险餐厅', '丛林探险餐厅位于欢乐谷的森林恐龙区，这家开放式档口餐厅不仅是全园区所有餐厅中提供产品种类最多的餐厅，同时因为紧邻园区的镇园之宝“宽翼过山车”，它的人流量也是可以预见的庞大。坐在餐桌旁用餐，过山车就在眼前呼啸而过，相信这种独特的用餐体验能停留在你的记忆中很久。', '29.668933', '106.520470', '中式快餐/饮品/小吃', '10:00:00', '18:00:00', 0, 25, 25, '2024-04-03 14:35:52', '2024-04-09 17:41:46', 0);
INSERT INTO `restaurant_facility` VALUES (4, '维多利亚花园餐厅', '在浓郁欧式风情的欢乐时光区隐藏着一幢内部满是怀旧工业风情的建筑，它就是位于4D影院顶楼的维多利亚花园餐厅。这家以中式为主同时兼有中西不同口味的快餐厅提供各式主食、凉菜、饮品小吃等供游客自行选取。餐厅的户外用餐区紧邻观景露台，站在这里可以自由俯瞰整个欢乐谷的美丽风景。不论是用餐、观景还是短暂休息放松，这里都是上佳选择。', '29.666622', '106.519154', '中式快餐/西式快餐', '10:00:00', '18:00:00', 0, 30, 30, '2024-04-03 14:35:52', '2024-04-09 17:41:51', 0);
INSERT INTO `restaurant_facility` VALUES (5, '乐迪汉堡', '乐迪汉堡店，位于乐园的心脏地带，是每位游客尽享美食与欢乐的理想之选。店内环境明亮舒适，洋溢着轻松愉快的氛围。我们精选优质食材，手工现做每一个汉堡，保证新鲜美味。无论是经典牛肉汉堡，还是特色鸡肉汉堡，都能满足您的味蕾。此外，店内还提供各种小吃和饮品，让您在游玩之余，尽享美食的乐趣。快来乐迪汉堡店，与亲朋好友一起品尝美味，留下难忘的回忆吧', '29.667930', '106.518134', '西式快餐/饮品/小吃', '10:00:00', '18:00:00', 0, 10, 15, '2024-04-03 14:35:52', '2024-04-09 17:41:56', 0);
INSERT INTO `restaurant_facility` VALUES (6, 'testRestaurant', 'laborum pariatur velit anim', '29.666319', '106.518702', '中式快餐/饮品', '06:30:31', '13:00:11', 0, 5, 17, '2024-04-12 15:42:19', '2024-04-16 16:40:51', 1);
